Solve the following math problem: If you spend $120 from a total of $500, what fraction of your money have you spent?
Answer: $120 is 1/4 of $500, so you have spent 1/4 of your money.
The answer is: \frac{1}{4}

Solve the following math problem: A bag contains 20 candies, of which 8 are chocolate. What fraction of the candies are chocolate?
Answer: The fraction of chocolate candies is $\frac{8}{20} = \frac{2}{5}$.
The answer is: \frac{2}{5}

Solve the following math problem: A person has 120 marbles, 30 of which are blue. What fraction of the marbles are blue?
Answer: The fraction of the marbles that are blue is $\frac{30}{120} = \frac{1}{4}$.
The answer is: \frac{1}{4}
